import React from 'react';

const Header = () => {
  return (
    <header>
      <nav>
        <ul>
          <li><button>Logout</button></li>
          <li><button>Add House</button></li>
          <li><button>Add Person</button></li>
          <li><button>User Settings</button></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
